import React from "react";
import image1 from "../Images/Group 23.png";




const Footer = (props) => {
    return (
        <footer>
            <div className="footerDiv1">
                <p className="become_specialist">Стань профессионалом в веб-разработке</p>
                <a href="/">
                    <button><span className="start_free">Начать бесплатно</span></button>
                </a>
            </div>
            <div className="footerDiv2">
                <div className="foto1">
                   <a href={"/"}> <img src={image1} alt={props.title}/></a>
                </div>
                <div className="contacts">
                    <a href="/">Контакты</a>
                    <a href="/">Политика конфиденциальности</a>
                    <a href="/">Условия предоставления услуг</a>
                </div>
            </div>
        </footer>
    );
}
export default Footer;
